        <Carousel.Item>
          <img
            style={{ width: '100%', height: '400px' }}
            src={image1}
            alt="First slide"
          />
          {"Apple Headphones"}
        </Carousel.Item>
        {"hapop"}
      </Carousel>
    );
  }

export default ImageCarousel
